import './App.css';
import { Grid,Paper } from '@material-ui/core';
import Menu from './components/menu/MenuComponent.js'

function App() {
  return (
    <Grid container spacing={3}>
      <Grid item xs={12}>
        <Paper ><Menu /></Paper>
      </Grid>
    </Grid>
  );
}

export default App;
